import React from 'react' ;
import './footer.css';
import { Container,Row,Col,ListGroup,ListGroupItem } from 'reactstrap';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';

const quick__links=[
    {
        path:'/home',
        display:'Home'
    },
    {
        path:'/about',
        display:'About'
    },
    {
        path:'/tours',
        display:'Tours'
    },
];

const quick__links2=[
    {
        path:'/gallery',
        display:'Gallery'
    },
    {
        path:'/login',
        display:'Login'
    },
    {
        path:'/register',
        display:'Register'
    },
]

const Footer = () => {
    return (
        <Footer className='footer'>
            <Container>
                <Row>
                    <Col lg='3'>
                        <img src={logo} alt="" />
                        <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Iste repudiandae 
                            tempore ipsam eos nisi commodi alias, iure rem sed nemo similique error 
                            consequatur accusantium? Iste quae sapiente nihil numquam earum!</p>

                            <div className="social__links d-flex align-items-center gap-4">
                                <span>
                                    <Link to='#'>
                                        <i class='ri-youtube-line'/>
                                    </Link>
                                </span>

                                <span>
                                    <Link to='#'>
                                        <i class='ri-github-fill'/>
                                    </Link>
                                </span>

                                <span>
                                    <Link to='#'>
                                        <i class='ri-facebook-circle-line'/>
                                    </Link>
                                </span>

                                <span>
                                    <Link to='#'>
                                        <i class='ri-instagram-line'/>
                                    </Link>
                                </span>
                            </div>
                    </Col>
                </Row>
            </Container>
        </Footer>
    )
};

export default Footer;
